import imgsrc1 from '../src/Images/web.jpg'
import imgsrc2 from '../src/Images/web1.jpg'
import imgsrc3 from '../src/Images/web2.png'
import imgsrc4 from '../src/Images/web3.png'
import imgsrc5 from '../src/Images/web4.png'
import imgsrc6 from '../src/Images/web1.jpg'

const Data =[
    {
        imgsrc:imgsrc1,
        title:"Web Development"
    },
    {
        imgsrc:imgsrc2,
        title:"Android App"
    },
    {
        imgsrc:imgsrc3,
        title:"IOS App"
    },
    {
        imgsrc:imgsrc4,
        title:"SEO"
    },
    {
        imgsrc:imgsrc5,
        title:"Digital solutions"
    },
    {
        imgsrc:imgsrc6,
        title:"Maintainance"
    },
]

export default Data;
